    render() {
        var song = "";
        if (this.props.widget.value === "Inspirational") {
            song = Inspirational;
        }
        else if (this.props.widget.value === "Calm") {
            song = Calm;
        }
        else if (this.props.widget.value === "Relaxing") {
            song = Relaxing;
        }
        return(
            <div>
                <ReactHowler 
                    src={song}
                    playing={true}
                    volume={0.1}
